import React from 'react';
import './Catalog.css';

class Catalog extends React.Component {
	render () {
		//let output = <div><h2>Catalog</h2></div>;//Asignando una expresión JSX a una variable
		//return output;
		let title = 'Catalog';
		return <div><h2>{title}</h2></div>;
	}
}

export default Catalog;
